B.aiK=new A.cb(B.r5,"5. Cons\xe9quences du refus","Si vous refusez les cookies ou les supprimez :\n\nCookies strictement n\xe9cessaires :\nLe refus de ces cookies peut emp\xeacher le bon fonctionnement du site (navigation, formulaires, s\xe9curit\xe9).\n\nCookies de performance :\nLe refus n'affecte pas votre navigation mais nous emp\xeache d'am\xe9liorer le site gr\xe2ce aux statistiques.\n\nCookies fonctionnels :\nVos pr\xe9f\xe9rences (mode jour/nuit, langue) ne seront pas m\xe9moris\xe9es entre vos visites.\n\nNote : Le refus des cookies n'emp\xeache pas l'acc\xe8s au site mais peut d\xe9grader votre exp\xe9rience utilisateur.")
