B.aiL=new A.cb(B.Pt,"4. Comment g\xe9rer vos cookies ?",'Vous pouvez g\xe9rer vos cookies de plusieurs mani\xe8res :\n\nVia notre bandeau cookies :\nCliquez sur le lien "G\xe9rer mes cookies" en bas de page pour modifier vos pr\xe9f\xe9rences.\n\nVia votre navigateur :\nVous pouvez configurer votre navigateur pour accepter, refuser ou supprimer les cookies.\n\n\u2022 Chrome : Param\xe8tres > Confidentialit\xe9 et s\xe9curit\xe9 > Cookies\n\u2022 Firefox : Options > Vie priv\xe9e et s\xe9curit\xe9 > Cookies\n\u2022 Safari : Pr\xe9f\xe9rences > Confidentialit\xe9 > Cookies\n\u2022 Edge : Param\xe8tres > Cookies et autorisations de site\n\nApplication mobile :\nLes param\xe8tres de cookies sont accessibles dans les r\xe9glages de votre appareil.')
