B.aiO=new A.cb(B.Pv,"6. Dur\xe9e de conservation","Les cookies d\xe9pos\xe9s sur votre terminal ont les dur\xe9es de vie suivantes :\n\n\u2022 Cookies de session : supprim\xe9s \xe0 la fermeture du navigateur\n\u2022 Cookies de pr\xe9f\xe9rences : 12 mois maximum\n\u2022 Cookies d'analyse : 13 mois maximum\n\u2022 Cookie de consentement : 6 mois\n\n\xc0 l'expiration de ces d\xe9lais, les cookies sont automatiquement supprim\xe9s ou un nouveau consentement vous est demand\xe9.")
