B.aiP=new A.cb(B.Pf,"2. Donn\xe9es personnelles collect\xe9es","Dans le cadre de notre activit\xe9, nous collectons les donn\xe9es suivantes :\n\nDonn\xe9es d'identification :\n\u2022 Nom et pr\xe9nom\n\u2022 Adresse postale / lieu d'intervention\n\u2022 Num\xe9ro de t\xe9l\xe9phone\n\u2022 Adresse email\n\nDonn\xe9es relatives \xe0 la prestation :\n\u2022 Description du besoin (type de travaux, \xe9quipements)\n\u2022 Historique des interventions\n\u2022 Correspondances et \xe9changes\n\nDonn\xe9es techniques :\n\u2022 Adresse IP (logs serveur)\n\u2022 Donn\xe9es de navigation (cookies techniques)\n\nImportant : Aucune donn\xe9e bancaire n'est collect\xe9e directement via ce site.")
B.aiQ=new A.cb(B.iJ,"10. M\xe9diation de la consommation","Conform\xe9ment aux articles L.611-1 et suivants du Code de la consommation, en cas de litige non r\xe9solu, le consommateur peut recourir gratuitement \xe0 un m\xe9diateur de la consommation.\n\nM\xe9diateur comp\xe9tent :\n[\xc0 compl\xe9ter - Nom et coordonn\xe9es du m\xe9diateur]\nSite web : [\xc0 compl\xe9ter]\nEmail : [\xc0 compl\xe9ter]\n\nLe recours \xe0 la m\xe9diation est gratuit pour le consommateur.\n\nVous pouvez \xe9galement utiliser la plateforme europ\xe9enne de r\xe8glement en ligne des litiges :\nhttps://ec.europa.eu/consumers/odr")
