B.aiU=new A.cb(B.iG,"1. Qu'est-ce qu'un cookie ?","Un cookie est un petit fichier texte d\xe9pos\xe9 sur votre terminal (ordinateur, tablette, smartphone) lors de la consultation d'un site web.\n\nIl permet au site de m\xe9moriser des informations sur votre visite, comme votre langue pr\xe9f\xe9r\xe9e ou vos param\xe8tres d'affichage, facilitant ainsi votre navigation lors de vos prochaines visites.\n\nLes cookies ne peuvent pas endommager votre appareil et ne contiennent pas de virus.")
