B.aiY=new A.cb(B.iJ,"6. Prestations et devis","Devis et tarification :\n\u2022 Tous les devis sont \xe9tablis gratuitement et sans engagement\n\u2022 Un devis d\xe9taill\xe9 est obligatoirement fourni avant toute intervention\n\u2022 Les prix indiqu\xe9s sont en euros TTC (TVA applicable selon r\xe9gime)\n\u2022 La validit\xe9 d'un devis est de 30 jours sauf mention contraire\n\nConditions d'intervention :\n\u2022 Toute intervention n\xe9cessite l'acceptation pr\xe9alable du devis\n\u2022 Un acompte peut \xeatre demand\xe9 selon la nature des travaux\n\u2022 Les d\xe9lais d'intervention sont donn\xe9s \xe0 titre indicatif\n\u2022 Une facture d\xe9taill\xe9e est remise apr\xe8s chaque prestation\n\nGaranties :\n\u2022 Garantie l\xe9gale de conformit\xe9 (article L.217-4 du Code de la consommation)\n\u2022 Garantie des vices cach\xe9s (articles 1641 \xe0 1649 du Code civil)\n\u2022 Garantie d\xe9cennale sur les travaux concern\xe9s")
